function Places()
{


    return(
        <>
            <div className="bg-image" 
            style={{ 
                backgroundImage: "url('https://img.freepik.com/premium-photo/soft-blur-nature-background-abstract-modern-website-graphics-with-smooth-gradient-background_532332-40.jpg')", 
                backgroundRepeat: "no-repeat",
                backgroundSize:"100% 100%",
                height: "auto" 
            }}>

                <div>
                    <h1 className="text-center text-bg-dark"
                        style={{fontFamily:"monospace"}}
                    >Find Your Place...</h1>
                    <div class="container">
                        <form class="d-flex" role="search">
                        <input class="form-control me-2" type="search" placeholder="Search Your Destination!" aria-label="Search"/>
                        <button class="btn btn-outline-secondary" type="submit">
                            Go To Destination
                        </button>
                        </form>
                    </div>

                </div>

            </div>
        </>
    );
}

export default Places;
